pragma solidity ^0.4.25;

contract Pemilu {
    // Membuat model Kandidat
    struct Kandidat {
        uint id;
        string nama;
        uint jmlVote;
    }

    // Store accounts that have voted
    mapping(address => bool) public pemilih;
    // Store kandidat
    // Fetch Kandidat
    mapping(uint => Kandidat) public kandidat;
    // Store kandidat Count
    uint public pointKandidat;

    // voted event
    event votedEvent (
        uint indexed _kandidatId
    );

    constructor () public
    {
        tambahKandidat("Kandidat 1");
        tambahKandidat("Kandidat 2");
    }

    function tambahKandidat (string _nama) private
    {
        pointKandidat ++;
        kandidat[pointKandidat] = Kandidat(pointKandidat, _nama, 0);
    }

    function vote (uint _KandidatId) public {
        // require that they haven't voted before
        require(!pemilih[msg.sender]);

        // require a valid Kandidat
        require(_KandidatId > 0 && _KandidatId <= pointKandidat);

        // record that voter has voted
        pemilih[msg.sender] = true;

        // update Kandidat vote Count
        kandidat[_KandidatId].jmlVote ++;

        // trigger voted event
        emit votedEvent(_KandidatId);
    }
}
